const icon = "data:image/png;base64,";


const BlockType = require('../../extension-support/block-type');
const ArgumentType = require('../../extension-support/argument-type');

const minecraftICON = "data:image/png;base64,"

var io = require('socket.io-client')

class Minecraft {

  constructor() {
    this._socket = io("http://localhost:8080");
    console.log ("Connecting")
  }

  getInfo() {
    return {
      id: 'minecraft',
      name: 'Minecraft',

      colour: '#8BC34A',
      colourSecondary: '#7CB342',
      colourTertiary: '#689F38',

      menuIconURI: minecraftICON,

      blocks: [
        {
          opcode: 'postToChat',
          blockType: BlockType.COMMAND,
          text: 'post [A] to chat',
          arguments: {
            A:{
              type: ArgumentType.STRING,
              defaultValue: "Hello Minecraft"
            }
          }
        },
        {
          opcode: 'setPos',
          blockType: BlockType.COMMAND,
          text: 'teleport to [X], [Y], [Z]',
          arguments: {
            X:{
              type: ArgumentType.NUMBER,
              defaultValue: "0"
            },
            Y:{
              type: ArgumentType.NUMBER,
              defaultValue: "0"
            },
            Z:{
              type: ArgumentType.NUMBER,
              defaultValue: "0"
            }
          }
        },
        {
          opcode: 'setBlock',
          blockType: BlockType.COMMAND,
          text: 'draw [BLOCK] block at [X], [Y], [Z]',
          arguments: {
            X:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Y:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Z:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            BLOCK:{
              type: ArgumentType.STRING,
              defaultValue: ""
            }

          }
        },
        {
          opcode: 'setBlockVar',
          blockType: BlockType.COMMAND,
          text: 'draw block [BLOCK] at [X], [Y], [Z]',
          arguments: {
            X:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Y:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Z:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            BLOCK:{
              type: ArgumentType.STRING,
              menu: 'blockMenu'
            }


          }
        },
        {
          opcode: 'setBlocks',
          blockType: BlockType.COMMAND,
          text: 'draw cube of [BLOCK] from [X], [Y], [Z] to [X2] [Y2] [Z2]',
          arguments: {
            X:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Y:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Z:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            X2:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Y2:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Z2:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            BLOCK:{
              type: ArgumentType.STRING,
              menu: 'blockMenu'
            }


          }
        },
        {
          opcode: 'setBlocksVar',
          blockType: BlockType.COMMAND,
          text: 'draw cube of [BLOCK] from [X], [Y], [Z] to [X2] [Y2] [Z2]',
          arguments: {
            X:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Y:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Z:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            X2:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Y2:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Z2:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            BLOCK:{
              type: ArgumentType.STRING,
              defaultValue: ""
            }


          }
        },
        {
          opcode: 'drawLine',
          blockType: BlockType.COMMAND,
          text: 'draw line of [BLOCK] from [X], [Y], [Z] to [X2] [Y2] [Z2]',
          arguments: {
            X:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Y:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Z:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            X2:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Y2:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Z2:{
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            BLOCK:{
              type: ArgumentType.STRING,
              menu: 'blockMenu'
            }


          }
        },

        {
          opcode: 'getPosX',

          blockType: BlockType.REPORTER,

          text: 'x player position',
        },
        {
          opcode: 'getPosY',

          blockType: BlockType.REPORTER,

          text: 'y player position',
        },
        {
          opcode: 'getPosZ',

          blockType: BlockType.REPORTER,

          text: 'z player position',
        },
        {
          opcode: 'block',
          blockType: BlockType.REPORTER,
          text: '[BLOCKTYPE] block',
          arguments:{
            BLOCKTYPE:{
              type: ArgumentType.STRING,
              menu: 'blockMenu'
            }
   
          }
        },
        {
          opcode: 'getBlock',

          blockType: BlockType.REPORTER,

          text: 'get block from [X], [Y], [Z]',
          arguments: {
            X: {
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Y: {
              type: ArgumentType.NUMBER,
              defaultValue: 0
            },
            Z: {
              type: ArgumentType.NUMBER,
              defaultValue: 0
            }
          }
        }
      ],
      menus: {
          blockMenu: {
              items: ['Bedrock', 'Glass', 'TNT', 'Air', 'Brick', 'Brown wool']
          }
      }
    }
  }

  // get information about a block
  getBlock ({X, Y, Z}) {
    blockName = this.getBlockNet(X, Y, Z).then(data=>{return data})
    return (blockName)
  }
  getBlockNet (x, y, z) {
    return new Promise( resolve => {

      this._socket.emit('getBlock', x, y, z, function (name) {
        resolve(name)
      });
    });
  }

  setBlocks ({X, Y, Z, X2, Y2, Z2, BLOCK}){
    this._socket.emit ('putBlocks', X, Y, Z, X2, Y2, Z2, BLOCK)
  }
  setBlocksVar ({X, Y, Z, X2, Y2, Z2, BLOCK}){
    this._socket.emit ('putBlocks', X, Y, Z, X2, Y2, Z2, BLOCK)
  }

  drawLine ({X, Y, Z, X2, Y2, Z2, BLOCK}){
    this._socket.emit ('drawLine', X, Y, Z, X2, Y2, Z2, BLOCK)
  }

  setBlock ({X, Y, Z, BLOCK}){
    this._socket.emit ('putBlock', X, Y, Z, BLOCK)
  }

  setBlockVar ({X, Y, Z, BLOCK}){
    this._socket.emit ('putBlock', X, Y, Z, BLOCK)
  }

  getPosX () {
    x = this.getPosXNet().then(data=>{return data})
    return (x)
  }
  getPosXNet () {
    return new Promise( resolve => {
      this._socket.emit('getPosX', function (x) {
        resolve(x)
      });
    });
  }

  getPosY () {
    y = this.getPosYNet().then(data=>{return data})
    return (y)
  }
  getPosYNet () {
    return new Promise( resolve => {
      this._socket.emit('getPosY', function (y) {
        resolve(y)
      });
    });
  }

  getPosZ () {
    z = this.getPosZNet().then(data=>{return data})
    return (z)
  }
  getPosZNet () {
    return new Promise( resolve => {
      this._socket.emit('getPosZ', function (z) {
        resolve(z)
      });
    });
  }

  setPos ({X, Y, Z}) {
    this._socket.emit ("setPos", X, Y, Z)
  }

  postToChat ({A}){
    this._socket.emit("postToChat", A);
  }

  block ({BLOCKTYPE}){
    return (BLOCKTYPE)
  }
}

module.exports = Minecraft;

